import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link, useLocation  } from 'react-router-dom';
import Home from './Home';
import Challenges from './Challenges';
import Community from './Community';
import Settings from './Settings';
import SQLHeroLogo from '../../assets/images/SQL Hero Logo.png';
import HomeIcon from '../../assets/images/home-1.svg';
import ChallengesIcon from '../../assets/images/challenges.svg';
import CommunityIcon from '../../assets/images/community-1.svg';
import SettingsIcon from '../../assets/images/settings-1.svg';

function UserDashboard() {
    return (
        <main className='flex flex-row relative'>
            <nav className='h-screen fixed border-r border-gray-300 bg-white'>
                <ul className='main-nav flex flex-col w-60 px-5 py-10 gap-5'>
                    <li className='mb-5'>
                        <Link to="/dashboard"><img src={SQLHeroLogo} alt='SQL Hero Logo' className='h-10' /></Link>
                    </li>
                    <li className={`active ${location.pathname === '/dashboard' ? '' : 'inactive'}`}>
                        <Link to="/dashboard" className="block">
                            <img src={HomeIcon} alt='Home' className='w-8 inline-block align-middle' />
                            <span className='align-middle uppercase font-extrabold ms-4'>Home</span>
                        </Link>
                    </li>
                    <li className={`p-3 rounded-lg hover:bg-gray-100 hover:ring-gray-100 ${location.pathname.includes('/challenges') ? 'active' : ''}`}>
                        <Link to="/dashboard/challenges" className="block">
                            <img src={ChallengesIcon} alt='Challenges' className='w-8 inline-block align-middle' />
                            <span className='align-middle uppercase font-extrabold ms-4'>Challenges</span>
                        </Link>
                    </li>
                    <li className={`p-3 rounded-lg hover:bg-gray-100 hover:ring-gray-100 ${location.pathname.includes('/community') ? 'active' : ''}`}>
                        <Link to="/dashboard/community" className="block">
                            <img src={CommunityIcon} alt='Community' className='w-8 inline-block align-middle' />
                            <span className='align-middle uppercase font-extrabold ms-4'>Community</span>
                        </Link>
                    </li>
                    <li className={`p-3 rounded-lg hover:bg-gray-100 hover:ring-gray-100 ${location.pathname.includes('/settings') ? 'active' : ''}`}>
                        <Link to="/dashboard/settings" className="block">
                            <img src={SettingsIcon} alt='Settings' className='w-8 inline-block align-middle' />
                            <span className='align-middle uppercase font-extrabold ms-4'>Settings</span>
                        </Link>
                    </li>
                </ul>
            </nav>
            <Routes>
                <Route exact path="/dashboard" element={<Home />} />
                <Route path="/dashboard/challenges" element={<Challenges />} />
                <Route path="/dashboard/community" element={<Community />} />
                <Route path="/dashboard/settings" element={<Settings />} />
            </Routes>
        </main>
    );  
}

export default UserDashboard;
